import matplotlib.pyplot as plt
import matplotlib.animation as animation
import random
import time

from simulation.storage_map import originMapGroup
from simulation.storage_map import alternateMapGroup

plt.rcParams['figure.dpi'] = 300

'''
完成动画绘制
'''


class simAnimation():
    def __init__(self, alternate_dict_list, map_size, cell_size, cells_shape):
        self.alternate_dict_list_int = alternate_dict_list
        self.map_size = map_size
        self.cell_size = cell_size
        self.cells_shape = cells_shape
        self.im = None

        self.alter_map_group = alternateMapGroup(map_size, alternate_dict_list, cells_shape)

    def show_simu_group(self, update_cells, gif_save=0):
        figure = plt.figure('simu process')
        alter_map = self.alter_map_group

        def init():
            pic = alter_map.alternate_map_group(self.map_size, self.alternate_dict_list_int, self.cells_shape)
            self.im = plt.imshow(pic, animated=True)

        def update(update_cell):
            pic = alter_map.update_alternate_map_group(self.map_size, update_cell, self.cells_shape)
            self.im.set_array(pic)
            return pic

        # plt.axis("off")
        ani = animation.FuncAnimation(figure, update, frames=update_cells, interval=1000, init_func=init, blit=False)
        plt.ioff()

        if gif_save == 1:
            ani.save(f'./output/group_update_cells_passway_{str(random.randint(0, 9999))}.gif', writer='imagemagick',
                     fps=10)

        plt.show()


